import React from "react";
import WeatherIcon from "./WeatherIcon";

export default function Forecast() {
    return (
        <div className="Forecast">
            <div className="row">
                <div className="col-2">
                    <div className="forecast-day"> Mon</div>
                    <WeatherIcon code="01d" size={42}/>
                    <span>19</span> 10

                </div>
            </div>
        </div>

    )
}
